import React, {Component} from 'react';
import './LandingPage.css';
import SearchBar from "../components/SearchBar";

class LandingPage extends Component {
    render(){
        return (
            <div className = "landingPage">

                <div className = "searchBar">
                <SearchBar/>
                </div>

                <div className = "vidsDisplay">
                    <div className = "vidsContainer">
                       <div className = "vidsRow">
                            <div className = "videoContainer">
                            <iframe width="400" height="220" src="https://wis7202.s3-ap-southeast-2.amazonaws.com/vid_bird.mp4" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
                            <p>Description</p>
                            </div>

                            <div className = "videoContainer">
                            <iframe width="400" height="220" src="https://wis7202.s3-ap-southeast-2.amazonaws.com/vid_grass.mp4" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
                            <p>Description</p>
                            </div>

                            <div className = "videoContainer">
                            <iframe width="400" height="220" src="https://wis7202.s3-ap-southeast-2.amazonaws.com/vid_raining.mp4" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
                            <p>Description</p>
                            </div>
                        </div>
                    </div>
                </div>


            </div>
        );
    }
}

export default LandingPage;
